import React, { Component } from "react"
import PropTypes from 'prop-types';

/**
 *  Class to temporarily store sizes until Context /
 *  Redux is implemented
*/

class Sizes {
  static navbar = {
    height: "64px",
  }
  static page = {
    sideMargin: "90px",
  }
}

export default Sizes
